class Movie extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            url: this.props.posterurl,
            name: this.props.originalTitle,
            show:true
         }
    }
    render() { 
        return (
            <div>
                Berk
                {this.state.show ? <div>boom</div> : none}
            </div>
        )
    }
}

export default Movie;
